CREATE TABLE `company` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `header` varchar(255) NOT NULL DEFAULT '',
  `sticker` varchar(30) NOT NULL DEFAULT '',
  `report_id` int unsigned DEFAULT NULL COMMENT 'отчёт',
  `market_cap` int unsigned DEFAULT '0' COMMENT 'Капитализация, млрд руб',
  `ev` bigint DEFAULT '0' COMMENT 'EV, млрд руб',
  `revenue` bigint DEFAULT '0' COMMENT 'Выручка, млрд руб',
  `net_income` bigint DEFAULT '0' COMMENT 'Чистая прибыль',
  `div_yield` decimal(5,2) DEFAULT '0.00' COMMENT 'Див. доходность, акции обычные %',
  `div_yield_priv` decimal(5,2) DEFAULT '0.00' COMMENT 'Див. доходность, акции прив. %',
  `div_payout_ratio` decimal(12,2) DEFAULT '0.00' COMMENT 'ДД/ЧП % ; коэффициент дивидендных выплат в процентах от прибыли',
  `pe` decimal(12,2) DEFAULT '0.00' COMMENT 'P/E',
  `ps` decimal(12,2) DEFAULT '0.00' COMMENT 'P/S',
  `pb` decimal(12,2) DEFAULT '0.00' COMMENT 'P/B',
  `ev_ebitda` decimal(12,2) DEFAULT '0.00' COMMENT 'EV/EBITDA',
  `ebitda_margin` decimal(12,2) DEFAULT '0.00' COMMENT 'Рентаб. EBITDA',
  `debt_ebitda` decimal(5,2) DEFAULT '0.00' COMMENT 'Долг/EBITDA',
  `fundamental_link` varchar(255) NOT NULL DEFAULT '',
  `roa` decimal(12,2) DEFAULT NULL,
  `roe` decimal(12,2) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `sticker` (`sticker`)
) ENGINE=InnoDB AUTO_INCREMENT=241 DEFAULT CHARSET=utf8mb3 COMMENT='компании и фундаментальные показатели';
